import React,{useState} from 'react';
import './signIn.css';
// import { SignUpContext } from '../../contexts/SignUpContext';

function SignIn({email,pass}) {
    
  
    const [emailIn,setEmailIn] =useState(email);
    const [passIn,setPassIn] =useState(pass);

    const signIn = (e)=> {
        e.preventDefault();
        console.log(
            "The email :",emailIn,
            "the Pass : ",passIn
            
        )

    }
    return (
        <div className='form_container'>
         <form>
            <h3>Sign In</h3>
             <div className="email">
                 <h4>Email</h4>
                 <input type="email" placeholder='email..'
                     value={email}
                     onChange={(e)=> setEmailIn(e.target.value) }
                 />
             </div>
             <div className="pass">
                <h4>Password</h4>
                 <input type="password" placeholder='Password'
                 value={pass}
                 onChange={(e)=> setPassIn(e.target.value) }

                     
                 />
             </div>
             <button 
                type="submit"
                onClick={signIn}>
                Sign in</button>
         </form>
            
        </div>
    )
}

export default SignIn
